<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>TRADES</title>
  <script src="https://cdn.jsdelivr.net/npm/vue@2"></script>
  <style>
    html, body {
      font-family: Verdana, "Geneva CE", lucida, "Microsoft YaHei", sans-serif;
      margin: 0;
      padding: 0;
      background-color: #0B0E11;
      color: #FFF;
      font-size: 13px;
    }
    .title {
      font-weight: bold;
      padding: 15px 0;
      text-align: center;
      font-size: 36px;
      color: #F6465D;
      font-style:oblique;
    }
    .date {
      position: absolute;
      right: 20px;
      font-weight: lighter;
      color: #fff;
    }
    .app {
      max-width: 600px;
      padding: 0 5px;
      box-sizing: border-box;
      margin: 0 auto;
      position: relative;
    }
    .outer {
      display: flex ;
      padding: 8px;
      border-bottom: 1px solid #222;
    }
    .index {
      color: #888;
      margin-right: 5px;
    }
    .left {
      flex: 30%;
      display: flex;
    }
    .price {
      flex: 50%;
      text-align: center;
    }
    .right {
      flex-basis: 20%;
      color: #0ECB81;
      text-align: right;
    }
    .end {
      padding: 20px 0 30px;
      text-align: center;
      font-weight: lighter;
      color: #bbb;
    }

    .tags {
      display: flex;
      justify-content: space-between;
    }
    .tag {
      width: 42px;
      height: 60px;
      border: 1px solid #333;
      box-sizing: border-box;
      text-align: center;
      border-radius: 2px;
      overflow: hidden;
      font-weight: normal;
      cursor: pointer;
    }
    .tag:last-child {
      margin-right: 0;
    }
    .month {
      height: 22px;
      line-height: 22px;
      letter-spacing: 1px;
    }
    .day {
      height: 38px;
      line-height: 38px;
      font-weight: bold;
      color: #fff;
    }
    .active {
      box-sizing: border-box;
      border: 1px solid #4285f4;
    }
    .active .month {
      background-color: #0B0E11;
    }
    .active .day {
      background-color: #4285f4;
    }
  </style>
</head>
<body class="app">
  <div id="app">
    <div class="title">TRADES</div>
    <div v-if="list.length">
      <div class="outer">
        <div class="left">
          <div class="name">时间（秒:毫秒）</div>
        </div>
        <div class="price">价格（方向）</div>
        <div class="right">价值</div>
      </div>
      <div v-for="(l, i) in list" class="outer">
        <div class="left">
          <div class="index">{{ i + 1 }}.</div>
          <div class="name">{{ l.t }}</div>
        </div>
        <div class="price">{{ l.p }}（{{l.m ? '卖' : '买'}}）</div>
        <div class="right">{{l.u}}</div>
      </div>
    </div>
    <div class="end">END</div>
  </div>
